import './App.css';
import wave from './wave.svg'
import wave2 from './wave2.svg'
import Constellations from './Box';
function App() {
  return (
    <>
    <header>
      <div id="ambience">
        Ambience
      </div>
      <navbar>
        <a href="#">The Sky</a>
        <a href="#">Weather</a>
        <a href="#">Compass</a>
      </navbar>
    </header>
    <img src={wave}></img>
    <body>
        <Constellations/>
    </body>
    <img src={wave2}></img>
    <footer>
      <About/>
    </footer>
    </>
  );
}

const About = () => {
  return (
    <></>
  );
}
export default App;
